import "../LeftRight/EmailList.css";
import CheckBoxOutlineBlankIcon from "@mui/icons-material/CheckBoxOutlineBlank";
import StarBorderIcon from "@mui/icons-material/StarBorder";
import BookmarkBorderIcon from "@mui/icons-material/BookmarkBorder";
import { useHistory } from "react-router-dom";
import { useDispatch } from "react-redux";
import { MailActions } from "../store/MailSlice";

const EmailBody = ({ name, subject, message, time }) => {
  const history = useHistory();
  const dispatch = useDispatch();

  const setMailBodyhandler = () => {
    dispatch(
      MailActions.openBodyMessage({
        name,
        subject,
        message,
        time,
      })
    );
    history.push("/mail");
  };
  return (
    <div className="emailbody" onClick={setMailBodyhandler}>
      <div className="emailbody-left">
        <CheckBoxOutlineBlankIcon></CheckBoxOutlineBlankIcon>
        <StarBorderIcon></StarBorderIcon>
        <BookmarkBorderIcon></BookmarkBorderIcon>
        <h4>{name}</h4>
      </div>
      <div className="emailbody-mid">
        <div className="emailbody-mid-msg">
          <p>
            <b>{subject}</b>
            {message}
          </p>
        </div>
      </div>
      <div className="emailbody-right">
        <p>{time}</p>
      </div>
    </div>
  );
};

export default EmailBody;
